entrance = [42, 4]


def nearestExit(maze, entrance):
    #create stack
    next_step = collections.deque()
    row, col = entrance
    step = 0
    previous = set()

    next_step.append((row, col, step))

    while next_step:
        row, col, step = next_step.popleft()

        for direction in [1, -1]:
            if -1 < row + direction < len(maze) and maze[row + direction][col] == "." and ((row + direction, col)) not in previous:
                if row + direction == 0 or row + direction == len(maze) - 1 or col == 0 or col == len(maze[row]) - 1:
                    return step + 1
                else:
                    if ((row + direction, col)) not in previous:
                        next_step.append((row + direction, col, step + 1))
                        previous.add((row + direction, col))

            if -1 < col + direction < len(maze[row]) and maze[row][col + direction] == "." and ((row, col + direction)) not in previous:
                if col + direction == 0 or col + direction == len(maze[row]) - 1 or row == 0 or row == len(maze) - 1:
                    return step + 1
                else:
                    if ((row, col + direction)) not in previous:
                        next_step.append((row, col + direction, step + 1))
                        previous.add((row, col + direction))

        previous.add((row, col))


    return -1


print(nearestExit(maze, entrance))







